import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http'
import { environment } from './../../../../environments/environment'
import { Observable } from 'rxjs'
import { SharedService } from '../../../layout/shared.service'

@Component({
    selector: 'news-feed',
    templateUrl: './news-feed.component.html',
    styleUrls: ['./news-feed.component.scss'],
})
export class NewsFeedComponent implements OnInit {
    public newsFeedList:any[] = [];
    public NEWSFEEDLIST:any[] = [
        {
            "createdAt":"",
            "longDescription":"Sit eius itaque ab",
            "shortDescription":"My Virtual Home",
            "imageUrl":"data:image/png;base64,",
        },
        {
            "createdAt":"",
            "longDescription":"Eveniet sint accusamus doloribus nihil et occaecati assumenda",
            "shortDescription":"Buses within buses",
            "imageUrl":"data:image/jpeg;base64,"
        },
        {
            "createdAt":"",
            "longDescription":"Expedita sed alias ipsa autem omnis",
            "shortDescription":"My Virtual Beach House",
            "imageUrl":"data:image/jpeg;base64,"
        }
    ]
    constructor(
        private httpClient: HttpClient,
        public sharedServ: SharedService
    ) { }

    ngOnInit() {
        setTimeout(() => {
            this.sharedServ.showProgressBar = true;
        }, 100);
        this.getAllPosts().subscribe(data => {
            this.newsFeedList = data.length ? data : this.NEWSFEEDLIST;
            this.sharedServ.showProgressBar = false;
        })
    }

    public getAllPosts(): Observable<any> {
        return this.httpClient.get<any>(environment.hostName + "posts",
            { headers: this.sharedServ.getRequestHeaders() });
    }
}
